    "\n",
    "- <font color=red>cv2.equalizeHist(img)</font> : 히스토그램 균일화 함수\n",
    "\n",
    "\n",
    "- 콘트라스트가 너무 강조된 경향이 있으므로 cv2.createCLAHE() 함수를 적용하면 더 나은 결과가 가능함."
