    "- 영상을 NxN 블럭으로 공식을 사용해 변환하면, 분포되어 있던 화소값이 변환 후 이웃 화소 간 별 차이 없는 저주파 영역에 집중되는 것을 이용하여 압축을 시도하는 방식\n",
    "- DCT 방식을 사용하면 중복성 제거를 통해, 인간의 시각에는 둔감한 고주파 성분을 제거함으로서 압축이 가능해짐\n",
