    "# Wavelet 변환\n",
    "\n",
    "- MPEG4 영상압축에 사용하는 기법\n",
    "- 웨이블릿 변환은 고주파 성분의 신호에 대해서는 시간 해상도를 높이고 주파수 해상도를 낮추고, 저주파 성분의 신호에 대해서는 주파수 해상도를 높이고 시간해상도를 낮춤\n",
    "- STFT가 시간 분해능과 주파수 분해능 중 하나를 포기해야했다면 웨이블릿 변환은 교묘하게 둘다 고려한 방법 \n",
